      <p className="lead">Weâ€™re here to help! Reach out through any of the following methods:</p>
      <div className="mt-4">
        <p><strong>Email:</strong> support@vaidyakiyasahayaka.org</p>
        <p><strong>Phone:</strong> +91 6361861355</p>
        <p><strong>Address:</strong> 1st Floor, IT Bridge,Jayanagar 5th Block, Bengaluru, India</p>
